import React from 'react';
import Button from '@material-ui/core/Button';
import ClickAwayListener from '@material-ui/core/ClickAwayListener';
import Grow from '@material-ui/core/Grow';
import Paper from '@material-ui/core/Paper';
import Popper from '@material-ui/core/Popper';
import MenuItem from '@material-ui/core/MenuItem';
import MenuList from '@material-ui/core/MenuList';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from 'react-router-dom';
import { TextField } from '@material-ui/core';
import { useHistory } from 'react-router-dom';
import queryString from 'query-string';
const useStyles = makeStyles((theme) => ({
    input: {
        display: 'block',
        margin: '20px'
    },
    button: {
        width: '100%',
        textAlign: 'center',
    },
    button_confirm: {
        marginRight: '10px'
    }
}));

export default function MenuListComposition(props) {
    const classes = useStyles();
    console.log(props)
    const key = props.location.pathname;
    function test() {
        if (key === "/add-user") {
            return true;
        }
        else {
            return false;
        }
    }
    const history = useHistory();
    function huy() {
        history.push("/users")
    }


    return (
        <div className={classes.formUser}>
            <h2 className={classes.textAddUser}>Add User</h2>
            <div className={classes.form}>
                <TextField
                    className={classes.input}
                    id="standard-password-input"
                    label="Username"
                    type="Username"
                    autoComplete="current-Username"
                />
                <TextField
                    className={classes.input}
                    id="standard-password-input"
                    label="Email"
                    type="Email"
                    autoComplete="current-Email"
                />
                <TextField
                    className={classes.input}
                    id="standard-password-input"
                    label="Password"
                    type="Password"
                    autoComplete="current-Password"
                />

            </div>
            <div className={classes.button}>
                <Button className={classes.button_confirm} variant="contained" onClick={huy}>
                    Hủy
</Button>
                {test() === true
                    ?
                    <Button className={classes.button_confirm} variant="contained" color="primary">
                        Add
                    </Button>
                    :
                    <Button className={classes.button_confirm} variant="contained" color="primary">
                        Sửa
            </Button>
                }

            </div>
        </div>
    );
}
